import { useState } from "react"

import "./form.css"

function Form(){
    const [val,setval]=useState
    return(
        <>
        <form>

            <label>Enter your name:</label>

            <input type='text' value={val} onChange={(e)=> setval (e.target.val)}> </input>
        </form>
        </>
    )
}

export default Form;
